import pronouncing,random

def generate_poem(rhymeScheme,syllableListString,freqDict):
	'''
	This function takes two input strings and a dictionary as input to generate a poem.
	Should end up being one of the more ecomplex portions of the project.
	'''
	#TODO
	#Select a starting word for a line that is within the allowed syllable count followed by other words all the way up to the allowed
	_returnPoem=''
	currentPoem=[]
	currentLine=[]
	currentWord=''
	currentSyllableCount=0
	startList=freqDict['START']
	lastWord='ZZZZ'
	for eachLineNum in range(len(rhymeScheme)):
		print(eachLineNum)
		currentLine=[]
		currentSyllableCount=0
		currentWord=random.choice(startList)
		currentLine.append(currentWord)
		allowedSyllablesOnLine=int(syllableListString[eachLineNum])
		while currentSyllableCount<allowedSyllablesOnLine:
			try:
				possibleWords=freqDict[currentWord]
			except Exception as e:
				possibleWords=freqDict['START']
			currentWord=select_within_limit(possibleWords,allowedSyllablesOnLine-currentSyllableCount,lastWord)
			#print(currentWord,"AAAA")
			currentSyllableCount+=determine_syllables(currentWord)
			currentLine.append(currentWord.strip("'!"))
		lastWord=currentWord

		currentLine=' '.join(currentLine)
		currentPoem.append(currentLine)
	currentPoem='\n'.join(currentPoem)
	_returnPoem=currentPoem.lower()
	return _returnPoem

def select_within_limit(inputList,allowedSyllables,rhymesWith):
	'''
	This function selects a word from a list of words that meets the criteria
	'''
	#print("in list is ",inputList)
	choiceList=[]
	print(len(inputList))
	'''
	for word in inputList:
		#print(word,pronouncing.rhymes(rhymesWith))
		if determine_syllables(word)<=allowedSyllables and word in pronouncing.rhymes(rhymesWith):
			print('rhyme',rhymesWith,word)

			choiceList.append(word)
	if len(choiceList)==0:
		for word in inputList:
			if determine_syllables(word)<=allowedSyllables:
				choiceList.append(word)	
	'''
	if len(inputList)<=20:
		choiceList=[f for f in inputList if f in pronouncing.rhymes(rhymesWith)]
	if len(choiceList)==0:
		#print('defaulted')
		choiceList=inputList
	else:
		print('rhyme')
	_returnWord=random.choice(choiceList)
	print(_returnWord)
	return _returnWord


def determine_syllables(inputString):
	'''
	Uses a 'clever' method of syllable counting in order to determine the amount of syllables ina word. 
	Not entirely acurate with proper nouns but should be fine unless something strange requiring more complex code comes to fruition.
	'''
	count = 0
	vowels = 'aeiouy'
	#print(inputString,type(inputString))

	word = inputString.lower().strip(".:;?!")
	#print(word)
	if word=='' or word==None:
		return 0
	if word[0] in vowels:
	    count +=1
	for index in range(1,len(word)):
	    if word[index] in vowels and word[index-1] not in vowels:
	        count +=1
	if word.endswith('e'):
	    count -= 1
	if word.endswith('le'):
	    count+=1
	if count == 0:
	    count +=1
	return count
